export default function AuthContainer({ title, children, footer }) {
  return (
    <div className="auth-page">
      <div className="auth-card">
        <h2>{title}</h2>

        <div className="auth-body">{children}</div>

        {footer && <div className="auth-footer">{footer}</div>}
      </div>
    </div>
  );
}
